member.summary:
Indicated an action to Contactless Module if reset ("0") transaction amount.
- "0": unsupported;
- "1": support, but only online.

Contactless mode.
Terminal capability to the referred AID, in case it's located in a CTLS:
- "0": unsupported;
- "1": support VISA MSD;
- "2": support VISA qVSDC;
- "3": support MasterCard PayPass Magnetic Stripe;
- "4": support MasterCard PayPass M/Chip;
- "5": support Amex Expresspay Magnetic Stripe Mode;
- "6": support Amex Expresspay EMV mode.

Whether checksum exists or not.
- "0": unused;
- "1": used.

Card brand type:
- "1": debit;
- "2": credit.
